svg.script:
(function () {
        const svg = document.getElementById("visualization");
        const duration = Number(svg.getAttribute("data-duration")) || 10;

        const track = document.getElementById("track");
        const trackFill = document.getElementById("trackFill");
        const knob = document.getElementById("knob");
        const timeLabel = document.getElementById("timeLabel");
        const toggle = document.getElementById("toggle");
        const iconPause = document.getElementById("iconPause");
        const iconPlay = document.getElementById("iconPlay");

        const x1 = Number(track.getAttribute("x1"));
        const x2 = Number(track.getAttribute("x2"));

        let dragging = false;
        let playing = false;
        let raf = 0;

        svg.pauseAnimations();
        svg.setCurrentTime(0);

        setPlaying(true);

        function clamp(v, a, b) { return Math.max(a, Math.min(b, v)); }

        function clientToSvgX(clientX) {
        const pt = svg.createSVGPoint();
        pt.x = clientX;
        pt.y = 0;
        const m = svg.getScreenCTM();
        if (!m) return 0;
        const p = pt.matrixTransform(m.inverse());
        return p.x;
        }

        function setTime(t) {
        t = clamp(t, 0, duration);
        svg.setCurrentTime(t);
        updateUI(t);
        }

        function updateUI(t) {
        const ratio = duration === 0 ? 0 : (t / duration);
        const x = x1 + ratio * (x2 - x1);

        knob.setAttribute("cx", String(x));
        trackFill.setAttribute("x2", String(x));
        timeLabel.textContent = `${t.toFixed(2)}/${duration.toFixed(2)}s`;
        }

        function setFromClientX(clientX) {
        const x = clamp(clientToSvgX(clientX), x1, x2);
        const ratio = (x - x1) / (x2 - x1);

        setTime(ratio * duration);
        }

        function tick() {
        if (!playing) return;
        const t = svg.getCurrentTime();

        if (t > duration)
        svg.setCurrentTime(t % duration);

        updateUI(t % duration);
        raf = requestAnimationFrame(tick);
        }

        function setPlaying(next) {
        playing = next;
        iconPause.style.display = playing ? "block" : "none";
        iconPlay.style.display = playing ? "none" : "block";

        if (playing) {
        svg.unpauseAnimations();
        cancelAnimationFrame(raf);
        raf = requestAnimationFrame(tick);
        } else {
        svg.pauseAnimations();
        cancelAnimationFrame(raf);
        }
        }

        // Pointer handling for track + knob
        function onPointerDown(e) {
        dragging = true;
        svg.pauseAnimations();
        setPlaying(false);
        setFromClientX(e.clientX);
        (e.target.setPointerCapture?.(e.pointerId));
        }

        function onPointerMove(e) {
        if (!dragging) return;
        setFromClientX(e.clientX);
        }

        function onPointerUp() {
        dragging = false;
        }

        track.style.cursor = "pointer";
        knob.style.cursor = "pointer";

        track.addEventListener("pointerdown", onPointerDown);
        knob.addEventListener("pointerdown", onPointerDown);

        window.addEventListener("pointermove", onPointerMove);
        window.addEventListener("pointerup", onPointerUp);
        window.addEventListener("pointercancel", onPointerUp);

        // Toggle play/pause
        toggle.addEventListener("click", () => setPlaying(!playing));

        // Initialize UI
        updateUI(0);
        })();
